// src/Home.js
import React from "react";
import "./Home.css";

const Home = () => {
  return (
    <div className="container">
      <img className="image" src="/img/photo.png" alt="notfound" />
      <div className="right">
        <p className="p">Hi, I'm Valentina Barbetty</p>
        <p className="description">Fullstack developer</p>
        <button className="cv-btn">Download my CV</button>{" "}
        <button className="contact-btn">Contact Me</button>
        <div> <a href="https://github.com/valentinabarbetty"><img className="gh" src="/img/github.png" alt="notfound" /></a></div>

      </div>
    </div>
  );
};

export default Home;
